con:config.script:
context.setProperty("scriptLibrary", new scriptLibrary());
import java.util.Random  

class scriptLibrary{

    def runStep(log, testRunner, stepnumber, stepname)
    {
    		log.info("Step #"+stepnumber+" Request: " + stepname)
		testRunner.runTestStepByName(stepname)
		def responseContent = testRunner.testCase.getTestStepByName(stepname).httpRequest.response
		log.info("Step #"+stepnumber+" Response: " + stepname + " statusCode [" + responseContent.statusCode + "]")
        	return responseContent;
    }

    def setProperty(log, testRunner, propertyName, propertyValue)
    {
    		log.info("     Setting property [" + propertyName + "] with value [" + propertyValue + "]")
		testRunner.testCase.setPropertyValue( propertyName, propertyValue )
    }

    def logMessage(log, message)
    {
    		log.info("     " + message)
    }

}

import groovy.json.*

def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )

// Initialize the Script Library
testRunner.testCase.testSteps["Script Library"].run(testRunner, context)

// Get the environment details.
def env = testRunner.testCase.testSuite.project.getPropertyValue( "ENV" )

// Default to prod.  
def endpoint = "https://api.github.com/"
if( env == "dev" ){
	endpoint = "https://dev-api.github.com/"
}

log.info( "Environment [" + env + "]")
log.info( "Endpoint [" + endpoint + "]")

// Update the endpoint.
def testSteps = context.testCase.getTestStepList()
testSteps.each{
	if(it instanceof com.eviware.soapui.impl.wsdl.teststeps.RestTestRequestStep) {
		it.getHttpRequest().setEndpoint(endpoint)
	}
}

// Get the user logins. Default to prod.
def userfile = groovyUtils.projectPath + File.separator + "01-TestCase-IterateRepos-prod.txt"
if( env == "dev" ){
	userfile = groovyUtils.projectPath + File.separator + "01-TestCase-IterateRepos-dev.txt"
}

context.fileReader = new BufferedReader(new FileReader(userfile))
log.info( "Data loaded from file [" + userfile + "]")

// For each user... run the regression!
nextLine = context.fileReader.readLine()
while(nextLine != null){
	String[] propData = nextLine.split(",")

	log.info("***********************************************************************************")
	log.info("** Running Regression for userid [" + propData[0] + "] username [" + propData[1] + "]")
	log.info("***********************************************************************************")

	context.scriptLibrary.setProperty(log, testRunner, "USERID" , ""+propData[0])
	context.scriptLibrary.setProperty(log, testRunner, "USERNAME" , ""+propData[1])

	// Get the User.
	def step1ResponseObject = context.scriptLibrary.runStep(log, testRunner, 1, "GET /users/{userId} (200)")

	// Get the User's Repos.
	def step2ResponseObject = context.scriptLibrary.runStep(log, testRunner, 2, "GET /users/{userId}/repos (200)")
	def step2ResponseJson = new JsonSlurper().parseText(""+step2ResponseObject.getResponseContent())
	context.scriptLibrary.logMessage(log, "Repo Count ["+step2ResponseJson.data.size()+"]")

	// Get Each Repo.
	def limit = 2
	log.info("** NOTE: Only pulling first " + limit + " repo(s) due to github rate limiting.")
	if (step2ResponseJson.size() == 0){
		log.info("Step #3 SKIPPED (no repos found): GET /repos/{ownerId}/{repoId} (200)")		
	}else{
		for (i in 0..step2ResponseJson.size()-1){
			if(i < limit){
				context.scriptLibrary.setProperty(log, testRunner, "REPOID" , ""+step2ResponseJson[i].name)
				def step3ResponseObject = context.scriptLibrary.runStep(log, testRunner, 3 + "." + (i+1), "GET /repos/{ownerId}/{repoId} (200)")				
			}
		}
	}
	// Get the next user.
	nextLine = context.fileReader.readLine()
}

